Diagnosis
. Male palp (
Figs 24a–b
) with TA reduced to small bump below base of embolus. MA compact with slender prolateral projection but no other pronounced projections. Embolus broad, abruptly narrowing to pointed tip, with small projection on distal edge before tip. Cymbium with basal prolateral swelling topped by two to four stout macrosetae, adjacent row of stout hairs bordering retrolateral basal depression of cymbium. Palpal patella with single stout dorsal hair, palpal tibia without spines. Female epigynum (
Figs 24c–d
) with small lateral teeth. Tarsal organ capsulate, situated distally of trichobothria.
